INSERT INTO `exm_mailtemplate` VALUES (1,'Registration','Thanks for registration in Kadin','<div style=\"width: 98%;font-family: verdana;\">\r\n<div style=\"height: 60px;background: #6C7A95;\">\r\n    <h1 style=\"font-size: 16px;color: white;\"><a href=\"http://www.kaldin.com/otest/\"><img src=\"http://www.kaldin.com/otest/images/logo.png\" alt=\"kaldin\" width=\"125px\" border=\"0\" height=\"44px\"></a>Online Exam to Evaluate Knowledge</h1>\r\n</div>\r\n<div style=\"width: 96%;float: left;display:block;padding: 15px 25px;background: white;\">\r\n<p><label>Thank you for registering your account with Kaldin.</label></p>\r\n<p><label>Please activate your account by Clicking $$URL$$</label></p>\r\n<p><label>&nbsp;</label></p>\r\n<p><label><b>Username:</b>&nbsp;$$USERNAME$$</label></p>\r\n<p><label><b>Password:</b>&nbsp;$$PASSWORD$$</label></p>\r\n<p><label>&nbsp;</label></p>\r\n<p><label>Feel free to visit <a href=\"http://www.kaldin.com/\"> our site</a> for more detail</label></p>\r\n<p><label>&nbsp;</label></p>\r\n<p><label>Regards,</label></p>\r\n<p><label>Kaldin Support Team</label></p>\r\n</div>\r\n<div style=\"border-bottom: 1px solid #4D5B76;background: #6C7A95;position: relative;padding: 10px 0;font-size: 12px;color: white;bottom: 0;text-align: center;clear: both;\">© Copyright 2013 <a href=\"http://www.kaldin.com\" target=\"_blank\" style=\"color: white;\">kaldin.com</a></div>\r\n</div>','text/html','Kaldin <support@kaldin.com>','','','',''),(2,'Welcome','Welcome to Kaldin','<div style=\"width: 98%;font-family: verdana;\">\r\n<div style=\"height: 60px;background: #6C7A95;\">\r\n    <h1 style=\"font-size: 16px;color: white;\"><a href=\"http://www.kaldin.com/otest/\"><img src=\"http://www.kaldin.com/otest/images/logo.png\" alt=\"kaldin\" width=\"125px\" border=\"0\" height=\"44px\"></a>Online Exam to Evaluate Knowledge</h1>\r\n</div>\r\n<div style=\"width: 96%;float: left;display:block;padding: 15px 25px;background: white;\">\r\n<p><label>Thank for verifying you