INSERT INTO `exm_question` VALUES (177,0,'Note: assume all necessary imports are present Which of the following is a correct way to add an error to an ActionErrors object?',31,0,0,0,10,8,'',NULL,NULL),(178,0,'Which code snippet correctly implements execute method, that processes the specified request and creates the corresponding response?',31,0,0,0,10,8,'',NULL,NULL),(179,0,'Which class must your ActionForm extend to support Struts\' Validator features like \"automatic form validation\"?',31,0,0,0,10,8,'',NULL,NULL),(180,0,'All Struts forms extends ActionForm or its derived classes.',31,0,0,0,10,8,'',NULL,NULL),(181,0,'Every new user-defined action must extend the org.apache.struts.action.Action  class directly.',31,0,0,0,10,8,'',NULL,NULL),(182,0,'The validate() method in the ActionForm class has a return type of:',31,0,0,0,10,8,'',NULL,NULL),(183,0,'In Following Code <br>01: public class MyForm extends ActionForm  {<br> 02:  <br>03:     private String field; <br>04: <br> 05:     public void setField(String value) { <br>06:         field = value; <br>07:<br>     } 08:<br>  09:       public String getField() { <br>10:         return field;  <br>11:     } <br>12:  <br>13:     public ActionErrors validate(ActionMapping mapping, HttpServletRequest request) { <br>14:         ActionErrors errors = new ActionErrors();  <br>15:         return errors;  <br>16:     } <br>17:  <br>18: } <br>What will be the expected result when you try to compile and execute it?',31,0,0,0,10,8,'',NULL,NULL),(184,0,'What design pattern does the ActionServlet implement ?',31,0,0,0,10,8,'<br>',NULL,NULL),(185,0,'We can change name and Location of struts-config.xml.',31,0,0,0,10,8,'',NULL,NULL),(186,0,'What are the problems that the org.apache.struts.action.ActionServlet address?',31,0,0,0,10,8,'',NULL,NULL),(187,0,'To enable validation of your Struts forms with Validator framework, it\'s enough to do the following: - configure Validator framework in struts-config.xml - configure validation of your forms in Validator framework configuration file.',31,0,0,0,10,8,'',NULL,NULL),(188,0,'What are Tag Libraries provided with Struts?',31,0,0,0,10,8,'',NULL,NULL),(189,0,'The following declaration of dynamic form (without properties) in struts-config.xml  is valid. <form-bean name=\"dynaForm\" type=\"org.apache.struts.action.DynaActionForm\"> </form-bean>',31,0,0,0,10,8,'',NULL,NULL),(190,0,'What is not a scope values for the action tag?',31,0,0,0,10,8,'',NULL,NULL),(191,0,'Select components that can be used as model.',31,0,0,0,10,8,'',NULL,NULL),(192,0,'Which of the following action mapping is correct?',31,0,0,0,10,8,'',NULL,NULL),(193,0,'The <logic:iterate>  tag permits to iterate on the following objects of the form bean:',31,0,0,0,10,8,'',NULL,NULL),(194,0,'What is the name of the XML attribute in an <action>  tag you need to add in the struts-config.xml  in order to tell Struts to which page it should redirect if validation fails?',31,0,0,0,10,8,'',NULL,NULL),(195,0,'Struts Internationalization (i18n) can be done with some handy modifications in the existing application. Pick it from the following.',31,0,0,0,10,8,'',NULL,NULL),(196,0,'The reset method on an ActionForm normally used to',31,0,0,0,10,8,'',NULL,NULL),(197,0,'Each Struts Action element is uniquely identified by its',31,0,0,0,10,8,'',NULL,NULL),(198,0,'Use the following command to display the error on the jsp page:',31,0,0,0,10,8,'',NULL,NULL),(199,0,'An ActionForm is a JavaBean which extends the:',31,0,0,0,10,8,'',NULL,NULL),(200,0,'Which of these are the parameters of Action classs execute method ?',31,0,0,0,10,8,'',NULL,NULL),(293,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">Question It may be useful\r\nto think of character in fiction as a function of two ________\r\nimpulses: the impulse to individualize and the impulse to __________.</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(294,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">In the closing days of the\r\ncivil War, President Abraham Lincoln was planning to graciously\r\nwelcome the defeated confederate states back into the Union. After\r\nLincoln was assassinated, however, the \"Radical Republicans\"\r\nin Congress imposed martial law in the South, creating resentment\r\nthat caused problems well into this century. Had Lincoln lived, the\r\nhistory of regional conflict in 20th century America would have been\r\nconsiderably different. All of the following assumptions underline\r\nthe argument above EXCEPT</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(295,0,'<font size=\"2\">Some cadets are not hard working balwant is a cadet which of the following inference\r\n	definitely follows from these statements.</font>\r\n\r\n\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(296,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">Prof. Tembel told his\r\nclass that the method of student evaluation of teachers is not valid\r\nmeasure of teaching quality. Students should fill out questionnaires\r\nat the end of the semester when courses have been completed. Which of\r\nthe following, if true, provides support for Prof. Tembel`s proposal\r\n?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(297,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">Looking at a potrait, A\r\nsaid \"her mother?s only son is my cousin`s father\". My\r\ncousin is the daughter of my maternal uncle who has an only sister.\r\nwhose potrait was \"A\" looking at?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(298,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">In a game, exactly six\r\ninverted cups stand side by side in a straight line, and each has\r\nexactly one ball hidden under it. The cups are numbered consecutively\r\n1 through 6. Each of the balls is painted a single solid color. The\r\ncolors of the balls are green, magenta, orange, purple, red, and\r\nyellow. The balls have been hidden under the cups in a manner that\r\nconforms to the following conditions: The purple ball must be hidden\r\nunder a lower-numbered cup than the orange ball. The red ball must be\r\nhidden under a cup immediately adjacent to the cup under which the\r\nmagenta ball is hidden. The green ball must be hidden under cup 5.\r\nWhich of the following could be the colors of the balls under the\r\ncups, in order from 1 through 6?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(299,0,'<font size=\"2\">Which of the following letters would be 6th to the right of the letter, 18th from the right in the following of the alphabet?</font>',31,0,0,0,10,12,NULL,NULL,NULL),(300,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">If the angles of a\r\nTriangle ABC are in the ratio of 3: 5: 7, then the triangle is</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(301,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">If 2a + 2b = 1, and 6a -\r\n2b = 5, which of the following statements is true ?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(302,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">The sum of 5 consecutive\r\nintegers is 35. How many of the five consecutive integers are prime\r\nnumbers? </font>\r\n</p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(303,0,'\r\n\r\n\r\n	<meta http-equiv=\"CONTENT-TYPE\" content=\"text/html; charset=utf-8\">\r\n	<title></title>\r\n	<meta name=\"GENERATOR\" content=\"OpenOffice.org 3.2  (Linux)\">\r\n	<style type=\"text/css\">\r\n	<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in }\r\n	-->\r\n	</style>\r\n\r\n<p style=\"margin-bottom: 0in;\"><font size=\"2\">If x + 1/x = 5, then value\r\nof x3 + 1/x3 is</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(304,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">It is between 10 and 11\r\nthat the hour and minute hands of a watch are exactly coincident.\r\nWhat is the time?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(305,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">A sum of Rs. 25 consists\r\nof 130 coins. Some are 25 paise coins and some are 10 paise coins.\r\nWhat is the no. of 25 paise coins?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(306,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">5% income of A is equal to\r\n15% income of B and 10% income of B is equal to 20% income of C. If\r\nincome of C is Rs.2000, then total income of A,B and C is</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(307,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">In a certain town 40% of\r\nthe people have brown hair, 25% have brown eyes and 10% have both\r\nbrown hair and brown eyes. What percentage of the people in the town\r\nhas neither brown hair nor brown eyes?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(308,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">The length of three sides\r\nof a triangle is given below. For which one is it possible to\r\nconstruct a right angle triangle?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(309,0,'<ol><li><p style=\"margin-bottom: 0in;\"><font size=\"2\">In a group of 30\r\n	people the average height is 6 feet and 2 inches. Therefore, we can\r\n	assume that</font></p>\r\n</li></ol>\r\n<p style=\"text-indent: 0.5in; margin-bottom: 0in;\"><font size=\"2\">1.\r\neveryone is 6ft and 2 inches</font></p>\r\n<p style=\"margin-left: 0.1in; text-indent: 0.4in; margin-bottom: 0in;\">\r\n<font size=\"2\">2. most of the people are 6ft and 2 inches.</font></p>\r\n<p style=\"margin-left: 0.1in; text-indent: 0.4in; margin-bottom: 0in;\">\r\n<font size=\"2\">3. not all could be taller than 6ft and 2 inches. </font>\r\n</p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(310,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">In making a camera the\r\ncosts of labor and material are in the ratio of 3: 2. The\r\nmanufacturer sells the camera for Rs.800 making a profit of 20%. What\r\nis the cost of labor in the camera?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(311,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">50 copies of a book can be\r\npurchased for a sum payable 3 months hence while 51 copies can be had\r\nfor same sum for cash payment. What is the rate of interest per year?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(312,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">A bicycle costs Rs.2500\r\nwhen it is brand new. At the end of each year it is worth 4/5 of what\r\nit was at the beginning of the year. What is the motorcycle worth\r\nwhen it is 3 years old?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(313,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">A plane flies from Mumbai\r\nto Delhi at 600 kms per hour and returns along the same route at 400\r\nkms per hour. What is the average (Arithmetic mean) flying speed for\r\nthe entire route?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(314,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">A person makes a journey\r\nof 72 kms. He rides a cycle at 12kms/hr. After going a certain\r\ndistance, the cycle is punctured and he walks the remaining distance\r\nat 4 1/2 kms/hr. Find when the cycle is punctured if the total time\r\nfor the journey is 8 1/2 hrs.</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(315,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">A cistern has two taps\r\n(which fill it in 12 min. and 15 min. respectively) and an exhaust\r\ntap. When all the three taps are opened together it takes 20 min. to\r\nfill the cistern. How long will the exhaust tap take to empty it?</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(316,0,'<p style=\"margin-bottom: 0in;\"><font size=\"2\">For every novel in the\r\nschool library there are two science books, for each science book\r\nthere are seven economics books. Express the ratio of economics books\r\nto science books to novels in the school library as a triple ratio</font></p>\r\n',31,0,0,0,10,12,NULL,NULL,NULL),(1234,0,'<b>Point out the error in the following program. </b><br><br>#include&lt;stdio.h&gt;<br>int main()<br>{<br>&nbsp;&nbsp;&nbsp; struct emp<br>&nbsp;&nbsp;&nbsp; {<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; char name[20];<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbs